                        PSearchBooking_huongDanHoTro: "<p>                                    To receive the guide via SMS, please send a message from your phone number that is registered to buy ticket(s) to the number 8200 with the syntax: <strong>VT {0}</strong>. in which VT is the service activating code, {0} is your booking code.<br />                                                The fee of sending message to activate the service is 2.000 VN (two thousand dongs).                                            </p>                                            <p>                                                You can contact call center 19006469 for being supported.<br />                                                We serve you 24 hours a day and 7 days a week.                                            </p>",
                        PSearchBooking_huongDanHangDoi: "<p>                                                    E-ticket selling system will continuously check to search ticket(s) and send a notification for you via email right after finding suitable one(s). You have 10 minutes to confirm to buy ticket(s). If you miss the deadline to confirm then the reserved seat(s) will be revoked.                                                </p>                                                <p>                                                    Attention: The queue will be processed continuously many times and you can receive notification each time the system find the suitable seat(s). When you receive the notification, your place in the queue will be discarded even you confirm to buy ticket(s) or not.                                                </p>                                                <p>                                                    For your convenience, Vietnam Railways recommend you check email regularly to confirm to buy ticket(s) timely when a notification is sent from the e-ticket selling system.                                                </p>                                                <p>                                                    Because the seat providing system runs automatically at anytime, you can receive the notification at unsuitable times. To facilitate you to follow the ticket searching result in the queue, Vietnam Railways provides the service of receiving information via SMS. Please send a message to the number 8200 to activate the service with the syntax VT {0}.<br />                                                    In which:<br />                                                    VT is the service activating code <br />                                                    {0} is your booking code.<br />                                                    The fee of sending message to activate the service is 2.000 VN (two thousand dongs).                                                </p>",
